    <script>
    //first create a list of elements
var cells = document.getElementsByTagName("td");

//set the id for each one of them
for (i = 0; i < cells.length; i++) {
  cells[i].id = i;
  cells[i].onmouseover = function() {
    document.getElementById(this.id).classList.add("setBlack");
  };
}

//set the movement
var d = setInterval(function() {
  var blackList = document.querySelectorAll(".setBlack");
  for (j = 0; j < blackList.length; j++) {
    var myelement = blackList[j];
    curID = parseInt(myelement.id);
    if(curID == myelement.parentNode.lastElementChild.id){
        nextID = myelement.parentNode.firstElementChild.id;
    }else{
        var nextID = myelement.nextElementSibling.id;
    }

    document.getElementById(curID).classList.remove("setBlack");
    document.getElementById(nextID).classList.add("setBlack");
  }
}, 100);
    
    
    </script>
